import style from "./SearchListInput.module.css";
import { FaSearch } from "react-icons/fa";

import Button from "../../../../UI/Button";

function SearchListInput(props) {
  return (
    <div>
      <div className={style["input__container"]}>
        <input className={style.input} />
        <FaSearch className={style.icon} />
      </div>

      <div className={style["btn__container"]}>
        <p>Sort by</p>
        <Button className={style.btn}>time</Button>
        <Button className={style.btn}>price</Button>
        <Button className={style.btn}>sort by catrgory</Button>
      </div>
    </div>
  );
}

export default SearchListInput;
